import PropTypes from "prop-types";
import Button from "./Button";

const Header = ({ title }) => {
  return (
    <header className="header">
      <h1>{title}</h1>
      <Button backgroundColor="green" text="Hello" />
      <Button backgroundColor="red" text="Hi" />
      <Button backgroundColor="cyan" text="Yo!" />
    </header>
  );
};

// Set default properties
Header.defaultProps = {
  title: "Task Tracker",
};

// Set property types
Header.propTypes = {
  title: PropTypes.string.isRequired,
};

// Pass CSS styling
